INSERT INTO `type_plateforme` (`id_type`, `type`, `desc`) VALUES
(1, 'BO', 'Stations posees au fond de l\'ocean ou forages sous-marins (Boreholes/Bottom Landers)'),
(2, 'CT', 'Sondes CTD (Conductivite-Temperature-Profondeur) descendues depuis des navires de recherche (CTD Profiles)'),
(3, 'DB', 'Bouees derivantes (Drifting Buoys)'),
(4, 'FB', 'Systemes automatiques installes sur des ferrys de ligne pour mesurer la qualite de l\'eau durant leurs trajets reguliers (FerryBoxes)'),
(5, 'GL', 'Planeurs sous-marins autonomes qui se deplacent en changeant leur flottabilite (Gliders)'),
(6, 'ML', 'Petits capteurs (mini-enregistreurs) autonomes fixes sur du materiel de peche ou des bouees legeres (Mini-Loggers)'),
(7, 'MO', 'Bouees ancrees (fixes) qui mesurent en continu a un point precis (Fixed Mooring/Moored Buoys)'),
(8, 'PF', 'Flotteurs profilants (type Argo) qui derivent et plongent verticalement (code alternatif utilise pour certaines nomenclatures Coriolis) (Profiling Floats - Alternative code)'),
(9, 'PR', 'Flotteurs profilants (type Argo) qui derivent et plongent verticalement (Profiling Floats)'),
(10, 'SD', 'Drones de surface a voile ou bouees derivantes de surface (Saildrones/Surface Drifters)'),
(11, 'TG', 'Maregraphes, generalement installes sur les cotes pour mesurer le niveau de la mer (Tide Gauges)'),
(12, 'TS', 'Capteurs installes sur la coque des navires (souvent de commerce ou de recherche) pour mesurer la surface le long de leur route (ThermoSalinographs)'),
(13, 'XB', 'Sondes de temperature jetables lancees depuis des navires en mouvement (Expendable Bathythermographs)');
